import CommunityItem from "./CommunityItem";

const CommunityList = ({ communityList }) => {
  return (
    <div className="CommunityList">
      <div>
        <h4>커뮤니티 리스트</h4>
      </div>
      {communityList.map((it) => (
        <CommunityItem key={it.id} {...it} />
      ))}
    </div>
  );

  CommunityList.defaultProps = {
    communityList: [],
  };
};

export default CommunityList;
